contract IFOM is Base {
    using SafeMath for uint256;

    struct Step {
        address target;
        bytes   funcraw;
        uint    value;
    }

    event Log(uint amount);

    constructor(address[] memory workers) public {
        super.addWorkers(workers);
    }

    function balance(address token) 
        public view
        returns (uint amount)
    {
        if (isETH(token)) {
            return address(this).balance;
        }
        return IERC20(token).balanceOf(address(this));
    }

    function transferERC20From(address token, address from,  address to, uint amount) 
        onlyWorkerOrOwner public 
    {
        TransferHelper.safeTransferFrom(token, from, to, amount);
    }

    function xSwapExactTokensForTokens(
        address router,
        address[] memory path,
        uint amountIn,
        uint amountOutMin,
        address to,
        uint deadline
    )
        onlyWorkerOrOwner public 
        returns (uint[] memory amounts)
    {     
        uint amount = amountIn > 0 ? amountIn : balance(path[0]);
        amounts = IUniswapV2Router(router).swapExactTokensForTokens(
            amount,
            amountOutMin,
            path,
            to,
            deadline
        );
    }

    function xAddLiquidity(
        address router,
        address tokenA,
        address tokenB,
        uint amountADesired,
        uint amountBDesired,
        uint amountAMin,
        uint amountBMin
    ) 
        onlyWorkerOrOwner public 
        returns (uint amountA, uint amountB, uint liquidity)
    {
        require(amountADesired <= balance(tokenA), "uniswapAddLiquidity tokenA low");
        require(amountBDesired <= balance(tokenB), "uniswapAddLiquidity tokenB low");

        IERC20 TokenA = IERC20(tokenA);
        IERC20 TokenB = IERC20(tokenB);

        if (TokenA.allowance(address(this), router) > 0) {
            TokenA.approve(router, 0);
        }
        TokenA.approve(router, amountADesired);

        if (TokenB.allowance(address(this), router) > 0) {
            TokenB.approve(router, 0);
        }
        TokenB.approve(router, amountBDesired);

        (amountA, amountB, liquidity) = IUniswapV2Router(router).addLiquidity(
            tokenA,
            tokenB,
            amountADesired,
            amountBDesired,
            amountAMin,
            amountBMin,
            address(this),
            block.timestamp + 10
        );
    }

    function xRemoveLiquidity(
        address router,
        address tokenA,
        address tokenB,
        uint liquidity,
        uint amountAMin,
        uint amountBMin,
        address lp
    )
        onlyWorkerOrOwner public 
        returns (uint amountA, uint amountB)
    {
        // require(liquidity <= balance(lp), "uniswapAddLiquidity tokenA low");

        uint liquidityLP = liquidity > 0 ? liquidity : balance(lp);

        IERC20 TOKEN_LP_UNI = IERC20(lp);

        if (TOKEN_LP_UNI.allowance(address(this), router) == 0) {
            TOKEN_LP_UNI.approve(router, liquidity);
        }

       (amountA, amountB) = IUniswapV2Router(router).removeLiquidity(
            tokenA,
            tokenB,
            liquidityLP,
            amountAMin,
            amountBMin,
            address(this),
            block.timestamp + 10
        );
    }

    function xLog(
        uint amount
    )
        public
    {   
        emit Log(amount);
    }

    function xProxy(
        address targetAddr,
        bytes   memory funcraw
    ) 
        onlyWorkerOrOwner public payable
    {
        (bool success, ) = address(targetAddr).call{value: msg.value}(funcraw);
        require(success, 'Call target FAILED');
    }

    function xProxySteps(
        Step[] memory steps
    ) 
        onlyWorkerOrOwner public payable
    {
        for (uint i = 0; i < steps.length; i++) {
            Step memory step = steps[i];

            (bool success, ) = address(step.target).call{value: step.value}(step.funcraw);
            require(success, 'Call target FAILED');
        }
    }
}
